import * as Types from './types';

export const createProjcetDetailsSubmit = (projectDetails) => {
    return {
        type: Types.CREATE_PROJECT,
        projectDetails
    };
};

export const listProjectDetails = (listProject) => {
    return {

        type: Types.LIST_PROJECT_DETAILS,
        listProject
    };
};
